import React, { Component } from 'react';
import './App.css';
import TaskList from './Components/TaskList/taskList';




class App extends Component{
	constructor()
	{
		super();
		this.state = {
			route: 'home'
		}
	}



	render()
	{
		return (
	    	<div>
	    		<TaskList />
	    	</div>
		);
	}
}

export default App;
